import React from "react";
import Heading from "./Heading";

import Para from "./Para";
import ListN from "./ListN";
import add, { subtract, Multiply, divide } from "./Calc";

function App1() {
	return (
		<>
			<Heading />
			<Para />
			<ListN />
			<ul>
				<li>sum is {add(40, 4)}</li>
				<li>difference is{subtract(40, 4)}</li>
				<li>product is {Multiply(40, 4)}</li>
				<li>Quotient is {divide(40, 4)}</li>
			</ul>
		</>
	);
}
export default App1;
